import React, { Component } from 'react'

class Login extends Component {
    render() {
        return (
            <div class="login">
                <div class="help-center">
                    Gagal masukkan data? <a href="#">Hubungi admin</a>
                </div>

            </div> 
        )
    }
}
export default Login;
